import * as React from 'react';

interface INotesListProps {
    notes:Note[]
}

const NotesList: React.FC<INotesListProps> = (prop) => {
  return (
    <>
    <h2 className="mt-3">Notes</h2>
    </>
  )
};

export default NotesList;
